import * as React from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';


const DropDown=(props)=>{
    const [age, setAge] = React.useState('');
    const handleChange = (event) => {
        setAge(event.target.value);
      };
      const [datakey,setdatakey]=React.useState([])
      const [datavalues,setdatavalues]=React.useState([])

      React.useEffect(
        ()=>{setdatavalues(Object.values(props.list[0]))
            setdatakey(Object.keys(props.list[0]))
        },[]
      )
      console.log(datakey,'as');
    return(
        <FormControl variant="standard" sx={{ m: 1, minWidth: 120 }}>
        <InputLabel id="demo-simple-select-standard-label">Age</InputLabel>
        <Select
          labelId="demo-simple-select-standard-label"
          id="demo-simple-select-standard"
          value={age}
          onChange={handleChange}
          label="Age"
        >
         {props.list?.map((e,i)=>{
            return(<MenuItem key={i} value={10}>{Object.keys(e)} </MenuItem>)
         })}
         
        </Select>
      </FormControl>
    )
}
export default DropDown
